d3.custom = {};
d3.custom.slopegraph = function() {

    var opts = {
        width: window.innerWidth,
        height: 1200,
        labelLength: 200,
        margin: {top: 5, right: 30, bottom: 50, left: 30}
    };

    function exports(selection) {
        selection.each(function (dataset) {
            var chartHeight = opts.height - opts.margin.top - opts.margin.bottom;
            var chartWidth = opts.width - opts.margin.right - opts.margin.left;

            var parent = d3.select(this);
            parent.on("click", function(d){
                lines.attr("stroke-opacity",0.7);
            });
            var svg = parent.selectAll("svg.chart-root").data([0]);
            svg.enter().append("svg").attr("class", "chart-root")
                    .append('g').attr('class', 'chart-group');
            svg.attr({width: opts.width, height: opts.height});
            svg.attr("align","center");
            svg.exit().remove();
            var chartSvg = svg.select('.chart-group');

            var data = dataset.data;
            var scale = d3.scale.linear().domain([0,87]).range([0, chartHeight-250]);
            var linescale = d3.scale.linear().domain([1,945650]).range([0.5,50]);
            var scale2 = d3.scale.linear().domain([1,88]).range([0, chartHeight-250]);
            var scale3 = d3.scale.linear().domain([1,88]).range([0, chartHeight-250]);
            var lineColour = d3.scale.linear().domain([1,88]).interpolate(d3.interpolateHcl).range([d3.rgb("#007AFF"), d3.rgb('#FFF500')]);

            console.log(data)
            var lines = chartSvg.selectAll('path.slope-line').data(data);
            lines.enter().append("path");
            lines.attr({class:'slope-line',
            'origin':function(d){return dataset.label[0][d[0]];},
            'asylum':function(d){return dataset.label[1][d[1]];}
            });
            lines.attr('d', function(d){
                var start_x = opts.margin.left + opts.labelLength;
                var start_y = opts.margin.top + scale(d[0]) + d[5] - d[3] + (linescale(d[2])/2);
                var end_x = opts.width - opts.margin.right - opts.labelLength;
                var end_y = opts.margin.top + scale(d[1]) + d[6] - d[4] + (linescale(d[2])/2);
                return "M" + start_x + "," + start_y
                + " C" + (start_x + (end_x - start_x)/4) + "," + start_y
                + " " + (start_x + 3*((end_x - start_x)/4)) + ","+ end_y
                + " " + end_x + "," + end_y;
            });
            lines.attr("stroke-opacity",0.7);
            lines.attr("stroke-width", function(d){return linescale(d[2])+"px";});
            lines.attr("stroke", function(d){return lineColour(d[0]);});
            //lines.exit().remove();
/*            lines.attr({
                    class: 'slope-line',
                    x1: opts.margin.left + opts.labelLength,
                    x2: opts.width - opts.margin.right - opts.labelLength,
                    y1: function(d) { console.log(scale(d[0])); return opts.margin.top + scale(d[0]); },
                    y2: function(d) { return opts.margin.top + scale(d[1]); }});*/

/// LEFT LABELS
            var left_pos_data = dataset.position[0];

            var leftLabels = chartSvg.selectAll('text.left_labels')
                .data(left_pos_data);
            leftLabels.enter().append('text');
            leftLabels.attr({
                    class: 'left_labels slope-label',
                    x: opts.margin.left + opts.labelLength,
                    y: function(d,i) { return opts.margin.top + scale3(d) + (dataset.label_position[0][i]) - (dataset.label_width[0][i]/2);  },
                    dy: '.35em',
                    'text-anchor': 'end',
                    'name': function(d,i){return dataset.label[0][i]}})
                .text(function(d,i) { return dataset.label[0][i] }).style("font-size","12px");
            leftLabels.on("mouseenter",function(d) {
                var country_name = dataset.label[0][d-1];
                lines.attr('stroke-opacity',0);
                var selectedgroup = d3.selectAll('[origin="'+country_name+'"]');
                console.log(selectedgroup);
                selectedgroup.attr('stroke-opacity',0.7);
            });
            /*leftLabels.on("mouseout", function(d){
                lines.attr("stroke","white");
                lines.attr("stroke-opacity",0.7);
            });*/
            //leftLabels.exit().remove();

/// RIGHT LABELS
            var right_pos_data = dataset.position[1];

            var rightLabels = chartSvg.selectAll('text.right_labels')
                .data(right_pos_data);
            rightLabels.enter().append('text');
            rightLabels.attr({
                    class: 'right_labels slope-label',
                    x: opts.width - opts.margin.right - opts.labelLength,
                    y: function(d,i) { return opts.margin.top + scale2(d) + (dataset.label_position[1][i]) - (dataset.label_width[1][i]/2); },
                    dy: '.35em',
                    'name': function(d,i){return dataset.label[1][i]}
                })
                .text(function(d,i) { return dataset.label[1][i] }).style("font-size","12px");
            rightLabels.on("mouseenter",function(d) {
                var country_name = dataset.label[1][d-1];
                lines.attr('stroke-opacity',0);
                var selectedgroup = d3.selectAll('[asylum="'+country_name+'"]');
                console.log(selectedgroup);
                selectedgroup.attr('stroke-opacity',0.7);
            });
            /*rightLabels.on("mouseout", function(d){
                lines.attr("stroke","white");
                lines.attr("stroke-opacity",0.7);
            });*/
            lines.exit().remove();
            leftLabels.exit().remove();
            rightLabels.exit().remove();
        });
    }


    exports.opts = opts;
    createAccessors(exports);

    return exports;
}


createAccessors = function(visExport) {
    for (var n in visExport.opts) {
        if (!visExport.opts.hasOwnProperty(n)) continue;
        visExport[n] = (function(n) {
            return function(v) {
                return arguments.length ? (visExport.opts[n] = v, this) : visExport.opts[n];
            }
        })(n);
    }
};


